  array('id_ords' => 'restart_7674','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Panasonic','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-04-07','problem' => 'Power was cutting out when cord flexed at input.We opened the vacuum casing by removing all screws behind the bagless bucket cylinder, then un-clamped and un-crimped the power cable from the internal circuits, cut off about 6 inches of cable and fed it in further, stripped the cable down to wire ends, re-crimped it back to connect to the circuit, clamped the cable back down, and re-assembled the vacuum.We also un-clogged the hose where some muck was held back by a chip of wood.','googletrans' => 'Power was cutting out when cord flexed at input . We opened the vacuum casing by removing all screws behind the bagless bucket cylinder, then un-clamped and un-crimped the power cable from the internal circuits, cut off about 6 inches of cable and fed it in further, stripped the cable down to wire ends, re-crimped it back to connect to the circuit, clamped the cable back down, and re-assembled the vacuum . We also un-clogged the hose where some muck was held back by a chip of wood.','language' => 'en','fault_type_id' => '0','en' => '','de' => '','nl' => '','fr' => '','it' => '','es' => ''),
