  array('id_ords' => 'restart_8992','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Misc ~ Steam cleaner','product_category' => 'Vacuum','brand' => 'Polti','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2018-09-01','problem' => 'The steam cleaner was tripping the user\'s RCD at home. The machine was dismantled, signs of leakage and corrosion were observed on a parting line between a bolted-flange boiler, the item was given a fail by a portable appliance tester, and further testing found it to be short-circuiting to earth somewhere. By methodically disconnecting and testing for leakage, the problem was isolated to the heating element, which was found to be corroding. As the heaing element was soldered into the boiler and not replaceable, the entire boiler would have to be replaced at a significant part cost, and the great majority of the appliance\'s embodied energy. Whether to choose part replacement was left up to the user.','googletrans' => 'The steam cleaner was tripping the user\'s RCD at home. The machine was dismantled, signs of leakage and corrosion were observed on a parting line between a bolted-flange boiler, the item was given a fail by a portable appliance tester, and further testing found it to be short-circuiting to earth somewhere. By methodically disconnecting and testing for leakage, the problem was isolated to the heating element, which was found to be corroding. As the heaing element was soldered into the boiler and not replaceable, the entire boiler would have to be replaced at a significant part cost, and the great majority of the appliance\'s embodied energy. Whether to choose part replacement was left up to the user.','language' => 'en','fault_type_id' => '0','en' => '','de' => '','nl' => '','fr' => '','it' => '','es' => ''),
